import React, { useState } from 'react'
import './styles/TeachersList.css';
import { Grid } from '@mui/material';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import ImageIcon from '@mui/icons-material/Image';
import Divider from '@mui/material/Divider';
import { Button } from '@mui/material';
import DC from './Teachers components/DC';
import Shanjit from './Teachers components/Shanjit';
import Shawon from './Teachers components/Shawon';
function Teachers() {

  const [open, setOpen] = useState(false); 

  const [show,setShow] = useState(false)
  const [show1,setShow1] = useState(false)
  const [show2,setShow2] = useState(false)
  return (
  <div className='TeachersList style={{ transform: open ? "translateX(0px)" : "" }}'>
     <Grid container spacing={0} >
         <Grid item={5}>
         <div className='Teachers-list'>
    <List sx={{width: '100%',maxWidth: 360,bgcolor: 'background.paper',}}>
      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <ImageIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Kamrul Hasan" secondary="Founder and DC Cumilla" />
          {/*<Button onClick={()=>setShow(true)} >View profile</Button>*/}
          <Button  onClick={()=>setShow(!show)} >View profile</Button>

      </ListItem>
      <Divider variant="inset" component="li" />
      <Divider variant="inset" component="li" />


    <ListItem>
        <ListItemAvatar>
          <Avatar>
            <ImageIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Shanjit Mondol" secondary="Principal" />
        <Button onClick={()=>setShow1(!show1)}>View profile</Button>
    </ListItem>
      <Divider variant="inset" component="li" />
      <Divider variant="inset" component="li" />

      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <ImageIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Shanjit Mondol" secondary="Principal" />
        <Button onClick={()=>setShow2(!show2)}>View profile</Button>
      </ListItem>
      <Divider variant="inset" component="li" />
      <Divider variant="inset" component="li" />

    </List>

</div>
         </Grid>
        <Grid item={7}>
            <div>
              {
                show && <DC/>
              }
               <div> 
                {
                show1?<p><Shanjit/></p>:null
               }
                </div>
               <div>
                 {
                   show2?<Shawon/>:null
                 }
              </div> 


            </div>
        </Grid>
     </Grid>









  </div>
  )
}

export default Teachers
